import React from 'react';

function NavBar(){
    return (
        <nav className="mb-1 navbar navbar-expand-lg navbar-dark orange lighten-1">
            <a className="navbar-brand" href="#">Todo</a>
            <div className="collapse"></div>
        </nav>
    );
};

export default NavBar;
